import React from 'react';
import Tour from './Tour';
const Tours = ({api}) => {
  return (
    <section>
      <div className='title'>
        <h2>our tours</h2>
        <div></div>
      </div>
      {api.map(tour=>{
              return <Tour key={tour.id} {...tour} /> 
            }

            )}
    </section>

  )

};

export default Tours;
